import Layout from "../components/Layout";

import { Grid } from "@material-ui/core";

const About = () => (
  <Layout>
    <Grid container style={{ marginTop: 60, backgroundColor: "#eee" }}>
      <Grid item lg={2}></Grid>

      <Grid item lg={8}>
        <div>About Tracthon</div>
      </Grid>

      <Grid item lg={2}></Grid>
    </Grid>
  </Layout>
);

export default About;
